    false,nt"url": null,nt"notes": "These data were created as part of the
    National Oceanic and Atmospheric Administration Office for Coastal Management's
    efforts to create an online mapping viewer called the Sea Level Rise and Coastal
    Flooding Impacts Viewer. It depicts potential sea level rise and its associated
    impacts on the nation's coastal areas. The purpose of the mapping viewer is to provide
    coastal managers and scientists with a preliminary look at sea level rise (slr)
    and coastal flooding impacts. The viewer is a screening-level tool that uses nationally
    consistent data sets and analyses. Data and maps provided can be used at several
    scales to help gauge trends and prioritize actions for different scenarios. The
    Sea Level Rise and Coastal Flooding Impacts Viewer may be accessed at: http://www.coast.noaa.gov/slr
    This digital elevation model (DEM) is part of a series of DEMs produced for the
    National Oceanic and Atmospheric Administration Office for Coastal Management's
    Sea Level Rise and Coastal Flooding Impacts Viewer described above. The DEM created
    for this project was developed using the NOAA National Weather Service's Weather
    Forecast Office (WFO) boundaries. This DEM falls in the Guam (GUM) WFO and shows
    the elevation data for the island of Guam. This DEM includes the best available
    lidar data known to exist at the time of DEM creation that met project specifications,
    for the island of Guam. This DEM is derived from 2007 United States Army Corps of
    Engineers (USACE) lidar. Hydrographic breaklines were delineated using lidar intensity
    imagery generated from the lidar. The final DEM is hydro flattened such that water
    elevations are less than or equal to 0 meters. The DEM is referenced vertically
    to the North American Vertical Datum of 1988 (NAVD88) with vertical units of meters
    and horizontally to the North American Datum of 1983 (NAD83). The resolution of
    the DEM is approximately 3 meters.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
